package com.app.secret.entity;import com.app.secret.core.base.entity.BaseEntity;import io.swagger.annotations.ApiModel;import io.swagger.annotations.ApiModelProperty;import javax.persistence.Column;import javax.persistence.Table;/** * @author kexiaohong */@Table(name = "APP_SYSTEM_LOG")@ApiModel(value = "系统日志")public class AppSystemLog extends BaseEntity {    @Column(name = "SESSION_ID")    @ApiModelProperty(value = "SESSIONID")    private java.lang.String sessionId;    @Column(name = "ACCESS_NAME")    @ApiModelProperty(value = "操作人")    private java.lang.String accessName;    @Column(name = "ACCESS_TOKEN")    @ApiModelProperty(value = "操作人token")    private java.lang.String accessToken;    @Column(name = "ACCESS_TIME")    @ApiModelProperty(value = "操作时间")    private java.util.Date accessTime;    @Column(name = "ACCESS_IP")    @ApiModelProperty(value = "用户IP")    private java.lang.String accessIp;    @Column(name = "ACCESS_SYSTEM")    @ApiModelProperty(value = "用户系统")    private java.lang.String accessSystem;    public java.lang.String getSessionId() {        return this.sessionId;    }    public void setSessionId(java.lang.String sessionId) {        this.sessionId = sessionId;    }    public java.lang.String getAccessName() {        return this.accessName;    }    public void setAccessName(java.lang.String accessName) {        this.accessName = accessName;    }    public java.lang.String getAccessToken() {        return this.accessToken;    }    public void setAccessToken(java.lang.String accessToken) {        this.accessToken = accessToken;    }    public java.util.Date getAccessTime() {        return this.accessTime;    }    public void setAccessTime(java.util.Date accessTime) {        this.accessTime = accessTime;    }    public java.lang.String getAccessIp() {        return this.accessIp;    }    public void setAccessIp(java.lang.String accessIp) {        this.accessIp = accessIp;    }    public java.lang.String getAccessSystem() {        return this.accessSystem;    }    public void setAccessSystem(java.lang.String accessSystem) {        this.accessSystem = accessSystem;    }}